/* ==UserStyle==
@name           Dark Theme for TinEye Search
@version        1.0.0
@namespace      https://userstyles.org/users/900511
@description    Dark Theme for TinEye Search
@author         ShadowIX
@license        CC BY-NC-SA
==/UserStyle== */

@-moz-document domain("tineye.com"){
:root
{
    --Result: #1f313e;
    --Header: #243542;
    --UnderSearch: #1c3a50;
}

/* Background */
body
{
    background: var(--Header);
}

header
{
    background: var(--Header);
}

header h1 a, div.col-md-4:nth-child(1) > h1:nth-child(1) > a:nth-child(1)
{
    background-image: url(data:image/png;base64,);
}

.query-summary
{
    background: var(--UnderSearch);
    border-bottom: 2px solid #38aec69c;
}

#results-div
{
    background: var(--UnderSearch);
}

.search-container
{
    background: linear-gradient(90deg, rgba(0, 56, 96, 1) 0%, rgba(44, 113, 161, 1) 50%, rgba(0, 56, 96, 1) 100%);
    border-top: 2px dashed #f9feff38;
    border-bottom: 2px dashed #f9feff38;
}

/* Text ----------------------------------------------------------------------------------------------------------------------------------- */
h1, h2, h3, h4, h5
{
    color: white;
}

p, strong, span
{
    color: white !important;
}

/* Links -----------------------------------------------------------------------------------------------------------------------------------*/
h4 > a
{
    color: #FFD337 !important;
}

p > a
{
    color: #9df9ff !important;
}

a
{
    color: rgb(59, 199, 232) !important;
}

.pagination
{
    color: red;
}

/* Search Box -----------------------------------------------------------------------------------------------------------------------------------*/
.search-container .search .image-url
{
    color: #fff;
    background-color: var(--Header);
    border: 1px solid white;
}

.search-container .search #upload-button
{
    color: #fff;
    background-color: var(--Header);
    border: 1px solid white;
}

.search-container .search #upload-button:hover
{
    color: #3232ff;
    background-color: rgb(48, 246, 246);
}

/* Filter Box -----------------------------------------------------------------------------------------------------------------------------------*/
.sorting-row button
{
    background-color: var(--Header);
    border: 1px solid #6b92b5;
    color: #e1e6ec;
}

.sorting-row .dropdown-menu
{

    border: 2px solid #6b92b5;
}

.dropdown-menu
{
    background-color: var(--Header);
    border: 1px solid #6b92b5;
}

.sorting-row .typeahead
{
    background-color: var(--Header);
}

.sorting-row .typeahead.field
{
    color: #fff;
    border-color: #6b92b5;
}

.domain_filter .tt-highlight
{
    background-color: var(--Header);
}

.domain_filter .tt-menu
{
    background-color: var(--Header);
    border: 2px solid #6b92b5;
}

.domain_filter .tt-suggestion
{
    color: #fff;
}

/* Compare Group -----------------------------------------------------------------------------------------------------------------------------------*/
.compare-popup
{
    background-color: var(--Header);
    color: #ffebeb;
    border: 2px solid #6b92b5;
}

.compare-popup .overlay-detail
{
    background-color: var(--Header);
    border: 1px solid #6b92b5;
}

.compare-popup .toggle .imagematch.active-right
{
    background-color: var(--Header);
}

.primary-btn, .primary-btn:hover
{
    color: #0f0f0f;
}

.compare-popup h4, .compare-popup h4 a
{
    color: #fff;
}

.compare-popup .toggle .yourimage.active-left
{

    background-color: #2B70A0;
    border: 1px solid #e6ebf1;
}

div.col-xs-12:nth-child(1)
{
    width: 80%;
}

div.col-xs-12:nth-child(2)
{
    width: 20%;
}

div.col-xs-12:nth-child(1)::after
{
    content: " | Â© 2022 Dark Theme By ShadowIX";
}
}
